import React from 'react'
import './style.css'

const HeaderTopbar = () => {
    return(	
        <div className="topbar">
            <div className="container">
                <div className="row">
                    <div className="col col-md-6 col-sm-12 col-12">

                    </div>
                </div>
            </div>
        </div>
    )
}

export default HeaderTopbar;
